import React, { Component } from 'react';
import WebsiteLayout from '../../components/wrapper/mainSite';

export default class MetroLinxTTP extends Component {
	render() {
		return (
			<WebsiteLayout>
				<div>MetriLinx Toronto Transit Plan</div>
			</WebsiteLayout>
		);
	}
}
